export const styles = {
  appBar: {
    backgroundColor: "#4580bf",
    align: "right",
    height: "50px",
    '& .MuiToolbar-regular': {
      minHeight: "50px"
    }
  },
  name: {
    color: "#dbdbdb",
  },
  link: {
    textTransform: "unset",
    color: "#dbdbdb",
    margin: "0 20px",
    textDecoration: "unset",

    "&:hover": {
     color: "#f1f1f1",
    }
  },
  logo: {
    textTransform: "unset",
    color: "#dbdbdb",
    margin: "0 20px",
    textDecoration: "unset",
  },
  rightToolbar: {
    marginLeft: "auto",
    marginRight: 10
  },
  paper: {
    marginTop: 8,
    display: 'flex',
    flexDirection: 'column',
    alignItems: 'center',
  },
  avatar: {
    margin: 1,
    backgroundColor: "#f1f1f1",
  },
  form: {
    width: '100%',
    marginTop: 1,
  },
  submit: {
    margin: 3,
  },
}
